// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
import React, { Component }  from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Spring , config } from 'react-spring/renderprops';
import logo from '../assets/leaf.svg';
//REDUX
import {  connect } from 'react-redux';
import PropTypes from 'prop-types';
import {  updateTab } from '../actions/tabActions';
// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
class MainNavigator extends Component{
    constructor(props){
      super(props);

    }
// ------------------ '(◣_◢)' ------------------
    selected(tab){
      console.log("Selected tab: ", tab);
      this.props.updateTab(tab);
    }
// ------------------ '(◣_◢)' ------------------
    componentWillMount(){
      console.log("MainNavigator has mounted.");
      this.props.updateTab("home");
    }
// ------------------ '(◣_◢)' ------------------
    render(){
      return(
          <Spring
            config={config.molasses}
            from={{opacity: '0', marginTop: '-500'}}
            to={{opacity: '1', marginTop: '0'}}
          >

            { props => (
              <div style={props}>

                  <div className="MainNavigatorBar">
                  <Navbar  bg="light" expand="lg" style={{opacity: "0.8",outline: "transparent"}}>
                    <Navbar.Brand>
                        <img
                            src={logo}
                            width="30"
                            height="30"
                        />
                    </Navbar.Brand>
                    <Navbar.Brand className="BrandName">Ashvattha</Navbar.Brand>
                    <Navbar.Toggle style={{outline: "transparent"}}  />
                    <Navbar.Collapse style={{outline: "transparent"}} >
                      <Nav justify variant="tabs" defaultActiveKey="home" style={{outline: "transparent"}}>
                        <Nav.Link eventKey="home" onSelect={()=>this.selected("home")}>Home</Nav.Link>
                        <Nav.Link eventKey="es" onSelect={()=>this.selected("tw")}>Theatre Workshop</Nav.Link>
                        <Nav.Link eventKey="crew" onSelect={()=>this.selected("corp")}>Corporate</Nav.Link>
                        <Nav.Link eventKey="servs" onSelect={()=>this.selected("evn")}>Events</Nav.Link>
                        <Nav.Link eventKey="market" onSelect={()=>this.selected("abt")}>About Us</Nav.Link>
                      </Nav>
                    </Navbar.Collapse>
                  </Navbar>
                  </div>

              </div>
            )}

          </Spring>
      );
    }
// ------------------ '(◣_◢)' ------------------

}
// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------

MainNavigator.propTypes = {
  updateTab: PropTypes.func.isRequired
};
// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------
export default connect(null, { updateTab })(MainNavigator);
